import React, { Component } from 'react';
import './Contenido.css';
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';
import * as usuariosActions from '../../../../actions/usuariosActions';

class Contenido extends Component {

    componentDidMount() {
        this.props.traerTodos();

    }

    showTable = () => {
        return (
            <table id="table-users">
                <thead>
                    <tr>
                        <th scope="col">#</th>
                        <th scope="col">Nombres</th>
                        <th scope="col">Apellidos</th>
                        <th scope="col">Usuario</th>
                        <th scope="col">Genero</th>
                        <th scope="col">Nombre negocio</th>
                        <th scope="col">Tipo negocio</th>
                        <th scope="col">Ciudad</th>
                        <th scope="col">Localidad</th>
                        <th scope="col">Acciones</th>
                    </tr>
                </thead>
                <tbody>
                    {this.ponerFilas()}
                </tbody>
            </table>
        )
    }
    ponerFilas = () => this.props.usuarios.map((usuario, index) => (
        <tr key={usuario.id}>

            <th scope="row">
                {index + 1}
            </th>

            <td>
                {usuario.nombres}
            </td>
            <td>
                {usuario.apellidos}
            </td>
            <td>
                {usuario.usuario}
            </td>
            <td>
                {usuario.genero}
            </td>
            <td>
                {usuario.nombre_negocio}
            </td>
            <td>
                {usuario.tipo_negocio}
            </td>
            <td>
                {usuario.ciudad}
            </td>
            <td>
                {usuario.localidad}
            </td>
            <td>

                <Link id="btn-edit" to={{
                    pathname: "/editar",
                    id: usuario.id,
                    nombres: usuario.nombres,
                    apellidos: usuario.apellidos,
                    usuario: usuario.usuario,
                    genero: usuario.genero,
                    nombre_negocio: usuario.nombre_negocio,
                    tipo_negocio: usuario.tipo_negocio,
                    ciudad: usuario.ciudad,
                    localidad: usuario.localidad
                }} className="valign-wrapper"><i className="material-icons">create</i>EDITAR</Link>

            </td>
        </tr>

    ));

    render() {

        return (

            <div id="contenido" className="row">
                <div className="col l12">
                    <div className="card-panel">
                        <div className="card-content">
                            <div className="a-right">
                                <Link to='/crear' id="crear_user" className="valign-wrapper"><i className="material-icons">add</i>CREAR</Link>
                            </div>

                        </div>
                    </div>
                </div>

            </div>


        );
    }
}

const mapToStateProps = (reducers) => {
    return reducers.usuariosReducers;
}
export default connect(mapToStateProps, usuariosActions)(Contenido);
